import Transaction from "./Transaction";

export default function TransactionHistory() {
  return (
    <div>
      <span className="subtitle">Recent Transaction History</span>
      <hr />
      <br />
      <Transaction />
      <Transaction />
      <Transaction />
      <br />
    </div>
  );
}
